import { Table, Divider, Tag, Button } from "antd";

const { Column } = Table;

const onMoreClick = e => {
  console.log(e.target.id);
};

const data = [
  {
    key: "1",
    buildingname: "승연관",
    button: (
      <Button id="승연관" onClick={onMoreClick}>
        More
      </Button>
    )
  },
  {
    key: "2",
    buildingname: "일만관",
    button: (
      <Button id="일만관" onClick={onMoreClick}>
        More
      </Button>
    )
  },
  {
    key: "3",
    buildingname: "월당관",
    button: (
      <Button id="월당관" onClick={onMoreClick}>
        More
      </Button>
    )
  },
  {
    key: "5",
    buildingname: "나눔관",
    button: (
      <Button id="나눔관" onClick={onMoreClick}>
        More
      </Button>
    )
  },
  {
    key: "6",
    buildingname: "이천환관",
    button: (
      <Button id="이천환관" onClick={onMoreClick}>
        More
      </Button>
    )
  },
  {
    key: "7",
    buildingname: "새천년관",
    button: (
      <Button id="새천년관" onClick={onMoreClick}>
        More
      </Button>
    )
  },
  {
    key: "9",
    buildingname: "성미가엘성당",
    button: (
      <Button id="성미가엘성당" onClick={onMoreClick}>
        More
      </Button>
    )
  },
  {
    key: "11",
    buildingname: "미가엘관",
    button: (
      <Button id="미가엘관" onClick={onMoreClick}>
        More
      </Button>
    )
  }
];

const BuildingList = () => {
  return (
    <>
      <Table
        style={{ width: "40%", marginTop: "80px" }}
        dataSource={data}
        pagination={false}
      >
        <Column title="건물명" dataIndex="buildingname" key="buildingname" />
        <Column title="" style={{ width: "80%" }} dataIndex="button" />
      </Table>
    </>
  );
};

export default BuildingList;
